import React, { Component }  from 'react';
import './styles.css';

class Popup extends Component {
    render() {
        return (
            <div className='popup'>
                <div className='popup\_inner'>
                    <button onClick={this.props.closePopup}>close me</button>
                </div>
            </div>
        );
    }
}

export default Popup;
